import React, { useEffect, useRef } from 'react';
import './ConsultModal.css';

interface ConsultModalProps {
  isOpen: boolean;
  onClose: () => void;
  children?: React.ReactNode;
}

const ConsultModal: React.FC<ConsultModalProps> = ({ isOpen, onClose, children }) => {
  const dialogRef = useRef<HTMLDivElement | null>(null);

  // închidere cu Escape
  useEffect(() => {
    if (!isOpen) return;
    const onKey = (e: KeyboardEvent) => {
      if (e.key === 'Escape') onClose();
    };
    window.addEventListener('keydown', onKey);
    return () => window.removeEventListener('keydown', onKey);
  }, [isOpen, onClose]);

  // focus inițial pe dialog
  useEffect(() => {
    if (isOpen) {
      setTimeout(() => dialogRef.current?.focus(), 0);
    }
  }, [isOpen]);

  if (!isOpen) return null;

  return (
    <div className="cmodal__overlay" role="presentation" onClick={onClose}>
      <div
        className="cmodal"
        role="dialog"
        aria-modal="true"
        aria-labelledby="consult-title"
        tabIndex={-1}
        ref={dialogRef}
        onClick={(e) => e.stopPropagation()}
      >
        {/* HEADER: roată stânga • titlu centrat • ✖ dreapta */}
        <div className="cmodal__header">
          <div className="cmodal__wheel" aria-hidden="true">
            <svg viewBox="0 0 100 100" className="wheel-svg" aria-hidden="true">
              <circle cx="50" cy="50" r="44" fill="none" stroke="currentColor" strokeWidth="8" />
              <circle cx="50" cy="50" r="12" fill="currentColor" />
              <g stroke="currentColor" strokeWidth="6" strokeLinecap="round">
                <line x1="50" y1="6"  x2="50" y2="26" />
                <line x1="50" y1="74" x2="50" y2="94" />
                <line x1="6"  y1="50" x2="26" y2="50" />
                <line x1="74" y1="50" x2="94" y2="50" />
                <line x1="18" y1="18" x2="32" y2="32" />
                <line x1="68" y1="68" x2="82" y2="82" />
                <line x1="18" y1="82" x2="32" y2="68" />
                <line x1="68" y1="32" x2="82" y2="18" />
              </g>
            </svg>
          </div>

          <h3 id="consult-title" className="cmodal__title">
            Obține o consultație acum
          </h3>

          <button className="cmodal__close" onClick={onClose} aria-label="Închide">✖</button>
        </div>

        <div className="cmodal__body">
          {children ?? (
            <>
              <p>Sună-ne la numerele de mai jos și te ajutăm imediat:</p>
              <div className="cmodal__phones">
                <a href="tel:+373123456789">+373 123 456 789</a>
                <a href="tel:+373987654321">+373 987 654 321</a>
              </div>
              <small className="cmodal__note">
                Disponibili Luni–Sâmbătă, 09:00–18:00.
              </small>
            </>
          )}
        </div>

        <div className="cmodal__actions">
          <button
            className="cmodal__btn cmodal__btn--primary"
            onClick={() => (window.location.href = 'tel:+373123456789')}
          >
            Sună acum
          </button>
          <button className="cmodal__btn" onClick={onClose}>Închide</button>
        </div>
      </div>
    </div>
  );
};

export default ConsultModal;
